;; gorilla-repl.fileformat = 1

;; **
;;; # Change the exposure (the contrast) of a picture 
;;; 
;;; Changing the exposure of a picture is rather easy and done simply using the function **convert-to**. 
;; **

;; @@
(ns inquisitive-pond
   (:require
     [opencv4.utils :as u]
     [opencv4.core :refer :all]))

(def org 
  (-> "resources/images/cat.jpg" imread (u/resize-by 0.2)))

(u/mat-view org)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x25e02511 \"BufferedImage@25e02511: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Making the image darker
;; **

;; @@
(->
 org
 clone
 (convert-to! -1 0.4 0)
 (u/mat-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6664da06 \"BufferedImage@6664da06: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Making the image brigther
;; **

;; @@
(->
  org
  clone
  (convert-to! -1 2 0)
  (u/mat-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3f16ffcf \"BufferedImage@3f16ffcf: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
